import React from "react";
import { Redirect } from "react-router-dom";

import AdminDashboard from '../pages/Admin/AdminDashboard/index'

import Users from '../pages/SuperAdmin/Users/index'

import AdminOrder from '../pages/Admin/Order/index';
import Orderpage from '../pages/Admin/Order/Orderpage'

import Project from '../pages/SuperAdmin/Project/index'
import ProjectPage from '../pages/SuperAdmin/Project/Projectpage';
import AssignProject from '../pages/SuperAdmin/Project/AssignProject'

import Services from '../pages/Admin/Services/index'
import CreateServices from '../pages/Admin/Services/CreateService';

import SubjectArea from '../pages/Admin/SubjectArea/index';
import CreateSubjectArea from '../pages/Admin/SubjectArea/CreateSubjectArea'

import Library from '../pages/Admin/Library/index'

const adminRoutes = [
    {path: "/admindashboard", component: AdminDashboard},

    { path: "/adminusers", component: Users },

    { path: "/adminorder", component: AdminOrder },
    { path: "/order-page/:id?", component: Orderpage },

    { path: "/adminprojects", component: Project },
    { path: "/adminprojectspage/:id?", component: ProjectPage },
    { path: "/adminassignprojects", component: AssignProject },

    { path: "/adminservices", component: Services},
    { path: "/admincreateservice/:id?", component: CreateServices},

    { path: "/adminsubjectarea", component: SubjectArea},
    { path: "/admincreatesubjectarea/:id?", component: CreateSubjectArea},

    { path: "/adminlibrary", component: Library},



    { path: "/", exact: true, component: () => <Redirect to="/admindashboard" /> }
]

export {adminRoutes}
